import "./navbar.css"
import React from "react";
import {Link} from 'react-router-dom';
import logo from '../assets/logo.png'

function Navbar() {
    return <nav>
        <div className="navbar">
            <Link to='/' className="nav-iten nav btn">
                <img src={logo} alt="logo"/>
            </Link>
            <Link></Link>
        </div>
    </nav>;
}

export default Navbar;
